import React from "react";

const dummyValues = {
  image: "saw.jpg",
  name: "Nathan's Saw",
  description: "This is my saw. It is like new.  Cuts wood well."
};

const ItemInfo = props => {
  <div>
    <img src={dummyValues.image} />
    <h2>{dummyValues.name}</h2>
    <p>{dummyValues.description}</p>
  </div>;
};

export default ItemInfo;
